import "./cart-item.styles.scss";

const CartItem = ({ cartItem }) => {
  const { name, imageUrl, quantity } = cartItem;
  return (
    <div>
      <img src={imageUrl} alt={name} />
      <div className="item-details">
        <span>{name}</span>
        <span>{quantity}</span>
        <span>
          {quantity} x ${price}
        </span>
      </div>
    </div>
  );
};

export default CartItem;
